<!doctype html>
<html>
    <head>
        <meta charset="utf-8">
        <title>抱歉，未找到该页面</title>
        <style type="text/css">
        * {margin:0;padding:0;}
        #doc {width:456px;margin:60px auto;}
        #cont {width:456px;min-height:187px;*height:187px;margin-bottom:25px;background:url(http://<?php echo DOMAIN_STATIC;?>/css/video/images/error_404.png) no-repeat;}
        #goback {padding-left:25px;color:#42a8e1;font-size:14px;}
        </style>
    </head>
    <body>
        <div id="doc">
            <div id="cont">
            </div>
            <a href="http://<?php echo DOMAIN_SITE;?>" id="goback"><noscript>返回首页</noscript></a>
        </div>
        <script type="text/javascript">
        (function(){
            var backEle = document.getElementById('goback');
            if(document.referrer && document.referrer.substr(0, backEle.href.length) == backEle.href){
                backEle.href = document.referrer;
                backEle.innerHTML = '返回上一页';
            } else {
                backEle.innerHTML = '返回首页';
            }
            var keyboard = [];
            document.onkeydown = (function(e){
                if((window.navigator.userAgent).toLowerCase().indexOf('msie') > -1 || document.getElementById('img404')){
                    return;
                }
                keyboard.push((e||event).keyCode);
                if(keyboard.toString().indexOf('100,96,100') + 1 || keyboard.toString().indexOf('52,48,52') + 1){
                    var img404 = new Image();
                    img404.setAttribute('id', 'img404');
                    img404.src = 'data:image/jpeg;base64,';
                    document.getElementById('cont').appendChild(img404);
                }
            });
        })();
        </script>
    </body>
</html>